import React from 'react';
import { useFormik } from 'formik';
import * as yup from 'yup';
import AppHeader from '/Users/nicolemerriman/Desktop/wanderlogixs-app/src/components/header.js'; // Update the path as needed
import './itinerary.css';

// Define the validation schema using Yup
const itinerarySchema = yup.object().shape({
    eventName: yup.string().required('Event name is required'),
    location: yup.string().required('Location is required'),
    startDate: yup.date().required('Start date is required').max(yup.ref('endDate'), 'Start date must be before end date'),
    endDate: yup.date().required('End date is required'),
    startTime: yup.string().required('Start time is required'),
    endTime: yup.string().required('End time is required'),
    description: yup.string(),
    notification: yup.string()
});

function Itinerary() {
    const formik = useFormik({
        initialValues: {
            eventName: '',
            location: '',
            startDate: new Date(),
            endDate: new Date(),
            startTime: '12:00',
            endTime: '12:00',
            description: '',
            notification: ''
        },
        validationSchema: itinerarySchema,
        onSubmit: (values, { resetForm }) => {
            // Handle form submission logic here
            console.log('Form data:', values);
            resetForm();
        }
    });

    return (
        <>
            <AppHeader />
            <div className='calendar-form-container'>
                <div className="calendar-header">
                    <div className="calendar-text">Your Itinerary</div>
                    <div className="underline"></div>
                </div>
                <form onSubmit={formik.handleSubmit} className="itinerary-form">
                    <div className="form-row">
                        <div className="input">
                            <input
                                type="text"
                                name="eventName"
                                onChange={formik.handleChange}
                                value={formik.values.eventName}
                                placeholder="Event Name"
                            />
                            {formik.touched.eventName && formik.errors.eventName ? (
                                <div className="error">{formik.errors.eventName}</div>
                            ) : null}
                        </div>
                        <div className="input">
                            <input
                                type="text"
                                name="location"
                                onChange={formik.handleChange}
                                value={formik.values.location}
                                placeholder="Location"
                            />
                            {formik.touched.location && formik.errors.location ? (
                                <div className="error">{formik.errors.location}</div>
                            ) : null}
                        </div>
                    </div>
                    <div className="form-row">
                        <div className="input">
                            <input
                                type="date"
                                name="startDate"
                                onChange={formik.handleChange}
                                value={formik.values.startDate.toISOString().split('T')[0]}
                                placeholder="Start Date"
                            />
                            {formik.touched.startDate && formik.errors.startDate ? (
                                <div className="error">{formik.errors.startDate}</div>
                            ) : null}
                        </div>
                        <div className="input">
                            <input
                                type="time"
                                name="startTime"
                                onChange={formik.handleChange}
                                value={formik.values.startTime}
                                placeholder="Start Time"
                            />
                            {formik.touched.startTime && formik.errors.startTime ? (
                                <div className="error">{formik.errors.startTime}</div>
                            ) : null}
                        </div>
                    </div>
                    <div className="form-row">
                        <div className="input">
                            <input
                                type="date"
                                name="endDate"
                                onChange={formik.handleChange}
                                value={formik.values.endDate.toISOString().split('T')[0]}
                                placeholder="End Date"
                            />
                            {formik.touched.endDate && formik.errors.endDate ? (
                                <div className="error">{formik.errors.endDate}</div>
                            ) : null}
                        </div>
                        <div className="input">
                            <input
                                type="time"
                                name="endTime"
                                onChange={formik.handleChange}
                                value={formik.values.endTime}
                                placeholder="End Time"
                            />
                            {formik.touched.endTime && formik.errors.endTime ? (
                                <div className="error">{formik.errors.endTime}</div>
                            ) : null}
                        </div>
                    </div>
                    <div className="form-row description-row">
                        <div className="input full-width">
                            <textarea
                                name="description"
                                onChange={formik.handleChange}
                                value={formik.values.description}
                                placeholder="Description"
                            />
                            {formik.touched.description && formik.errors.description ? (
                                <div className="error">{formik.errors.description}</div>
                            ) : null}
                        </div>
                    </div>
                    <div className="form-row button-row">
                        <div className="input reminder-select">
                            <label>
                                Set Reminder:
                                <select
                                    name="notification"
                                    onChange={formik.handleChange}
                                    value={formik.values.notification}>
                                    <option value="none">None</option>
                                    <option value="15min">15 minutes before</option>
                                    <option value="30min">30 minutes before</option>
                                    <option value="1hour">1 hour before</option>
                                    <option value="1day">1 day before</option>
                                </select>
                            </label>
                        </div>
                        <div className="itinerary-submit-container">
                            <button type="submit" className="btn itinerary-btn-primary submit">Submit</button>
                            <button type="button" className="btn itinerary-btn-secondary submit" onClick={() => formik.resetForm()}>Cancel</button>
                        </div>
                    </div>
                </form>
                {/* Calendar and other UI elements can be added here */}
            </div>
        </>
    );
}

export default Itinerary;
